You can use `toLowerCase` to make the comparison case insensitive.

```
const arr = ['apple', 'Banana', 'kiwi', 'mango'];

arr.sort((a, b) => {
  if (a.toLowerCase() < b.toLowerCase()) {
    return -1;
  }
  if (a.toLowerCase() > b.toLowerCase()) {
    return 1;
  }
  return 0;
});

console.log(arr);
```

